import React from 'react';
import Header2 from './Header2';
import ContainerContact from './img-contact';
import imgContact2 from './img-contact2';
export default function Page2() {


    let Img = imgContact2.map(ContainerContact => {

        return <Airbnb img={ContainerContact.img} name={ContainerContact.name} data={ContainerContact.data} />
    })


    return (

        <div>
            <Header2 />

            <div className='containerContainerContact'>
                {Img}



            </div>
            <div className='containerContainerContact'>

                <ContainerContact
                    img="https://a0.muscache.com/im/pictures/miso/Hosting-795487932530451641/original/8cd9f663-5636-4e67-8c6c-53cc4087c11f.jpeg?im_w=720"
                    name="Bayındır, Antalya, Turkey"
                    rating={4.5}


                    data="May 1 – May 6"
                    cost="₪11,335 for night"


                />
                <ContainerContact
                    img="https://a0.muscache.com/im/pictures/74102172/9815f41f_original.jpg?im_w=1200"
                    name="Bolzano, Italy"
                    rating={3}


                    data=" Sep 1 – 10"
                    cost="£238 for night"


                />
                <ContainerContact
                    img="https://a0.muscache.com/im/pictures/dfd2689a-0b62-43bc-8884-16a79b02cb19.jpg?im_w=1200"
                    name="Guyonvelle, France"
                    rating={2}

                    data="Jul 12 – 13"
                    cost="£758 for night"




                />
                <ContainerContact
                    img="https://a0.muscache.com/im/pictures/miso/Hosting-50486612/original/90436aff-6bfb-42c2-88dd-58ea62ca0786.jpeg?im_w=1200"
                    name="Villeneuve-Loubet, France"
                    rating={4}

                    data="Jun 18 – 20"
                    cost="£293 for night"




                />

            </div>
        </div>








    )
}
